query State($stateUri: String!) {
  states(uri: $stateUri) {
    end
    period
    start
    type
    uri
    relations {
      predicate
      entity {
        uri
        types {
          uri
          shortUri
          __typename
        }
        properties {
          value
          shortPredicate
          predicate
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
